window.bookSummaryJSON = "<p>HEROES have long been the protectors of humanity. These days, they find themselves under the employ of the government. Sure, the pay and benefits are good, but their jobs are high-stress and require long hours. As a result, Neil Harris, the fifth Hero to bear the name Striker, finds his work-life balance in shambles. Every day, Neil struggles to deal with a demanding workload, maintaining his relationship, and finding time to simply relax. Something is going to give soon, and he feels like it might just be him.</p> <p>The Superhero novel for those who can't quite find the time to listen.</p>"; 
